--
-- Table structure for table `user_details`
--

CREATE TABLE `user_details` (
  `id` bigint(40) NOT NULL,
  `user_id` bigint(40) DEFAULT NULL,
  `abn` varchar(200) DEFAULT NULL,
  `acn` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `street_address` varchar(255) DEFAULT NULL,
  `city` varchar(100) DEFAULT NULL,
  `state` int(2) DEFAULT NULL,
  `postcode` varchar(30) DEFAULT NULL,
  `ip_address` varchar(80) DEFAULT NULL,
  `two_factor_auth` int(1) DEFAULT NULL,
  `reset_token` varchar(200) DEFAULT NULL,
  `no_of_attempt` int(11) DEFAULT NULL,
  `block_until` datetime DEFAULT NULL,
  `organisation_name` varchar(255) DEFAULT NULL,
  `date_time` datetime DEFAULT NULL,
  `authcode` varchar(150) DEFAULT NULL,
  `custom_commission_split` longtext DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

